package main

func sort_ints(arr [50]int) [50]int {
	for i := 1; i < len(arr); i++ {
		for j:= i; (j > 0) && (arr[j-1] > arr[j]); j-- {
			var tmp = arr[j]
			arr[j] = arr[j-1]
			arr[j-1]=tmp
		}
	}
	return arr
}

func make_int_arr(mult int) [50]int {
	var x [50]int;
	for i := 0; i < 49; i++ {
	 	if (i % 2) == 0 {
			x[i] = i - (mult/2)
		} else {
			x[i] = i * mult
		}
	}
	return x
}

func main() {
	for i := 0; i < 150; i++ {
		var x [50]int
		x = make_int_arr(i)
		var int_sort = sort_ints(x)
		for z := 0; z < len(int_sort) - 1; z++ {
			print(int_sort[z], " ")
		}
		println()
	}
}
